import React, { Component } from 'react';
import './App.css';
import Dashboard from './compopnents/Dashboard';

class Main extends Component{

    render() {
        return (
            <div className="App">
                <header className="App-header">
                    <Dashboard/>
                </header>
            </div>
        );
      }

}

export default Main;
